import styles from "./index.module.scss";

export const Links = () => {
  return (
    <div className={styles.links}>
      <h4>Links</h4>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
        <li>4</li>
      </ul>
    </div>
  );
};
